import React from "react";
import { makeStyles, TextField } from "@material-ui/core";
import { formDataType } from "../Homepage";
import { ErrorType } from "../Homepage";
import SearchIcon from "@mui/icons-material/Search";

type DemoFormProps = {
  data: formDataType;
  setData: React.Dispatch<React.SetStateAction<formDataType>>;
  errors: ErrorType;
  setErrors: React.Dispatch<React.SetStateAction<ErrorType>>;
};

const useStyles = makeStyles({
  form: {
    border: "1px solid black",
    margin: "10px",
  },
  formGroup: {
    gap: "10px",
    display: "grid",
    gridTemplateColumns: "auto auto",
    padding: "10px",
    width: "100px",
  },
  formGroupAdd: {
    columnGap: "20px",
    display: "grid",
    gridTemplateColumns: "0.5fr 2fr 0.5fr 1.5fr",
    padding: "10px",
  },
  formGroupCTitle: {
    gridTemplateColumns: "2fr 0.5fr 1fr 0.5fr",
    gap: "25px",
    display: "grid",
    padding: "5px",
  },
  inputField: {
    border: "1px solid black",
    borderRadius: "50px",
    width: "130px",
  },
  smallInputField: {
    border: "1px solid black",
    borderRadius: "50px",
    width: "90px",
  },
  titleField:{
    textAlign: "left",
    textW
  },
  errorMessage: {
    Color: "red",
    padding: "10px",
  },
});

const CustomerSIAdd: React.FC<DemoFormProps> = (props) => {
  const classes = useStyles();

  // ============================== Methods =========================

  /** 
       This Method for get all change on the Input Field
      */
  const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    isValid();

    props.setData((prev) => {
      return {
        ...prev,
        [name]: value,
      };
    });

    props.setErrors((prev) => ({
      ...prev,
      [name]: "",
    }));
  };

  /** 
       This Method for validation on the Input Field
      */
  const isValid = () => {
    let hasError = false;
    const copyErrors: ErrorType = { ...props.errors };

    const validationFields = ["skill1"];

    for (let key in copyErrors) {
      if (
        validationFields.includes(key) &&
        props.data[key as keyof typeof props.data] === ""
      ) {
        copyErrors[key] = "required";
        hasError = true;
      } else {
        copyErrors[key] = ``;
      }
    }

    props.setErrors(copyErrors);

    return hasError;
  };

  return (
    <React.Fragment>
      <form className={classes.form}>
        <div className={classes.formGroupCTitle}>
          <label>Customer Supplementary Information</label>
          <label>Requester</label>
          <TextField
            id="requester"
            name="requester"
            // value={props.data.requester}
            className={classes.inputField}
            InputProps={{ disableUnderline: true }}
            onChange={handleChange}
          />
          <SearchIcon />
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Gender</label>
            <TextField
              id="gender"
              name="gender"
              // value={props.data.gender}
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Receipt address</label>
            <TextField
              id="receiptAddress"
              name="receiptAddress"
              // value={props.data.receiptAddress}
              className={classes.inputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Age</label>
            <TextField
              id="age"
              name="age"
              // value={props.data.age}
              className={classes.inputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Discount rate</label>
            <TextField
              id="discountRate"
              name="discountRate"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Customer factor</label>
            <TextField
              id="customerFactor"
              name="customerFactor"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Discount rate memo</label>
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Classification code</label>
            <TextField
              id="classificationCode"
              name="classificationCode"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Urge to distinguish</label>
            <TextField
              id="distinguish"
              name="distinguish"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Order category</label>
            <TextField
              id="orderCategory"
              name="orderCategory"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Closing date classification</label>
            <TextField
              id="closingDate"
              name="closingDate"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Collection method</label>
            <TextField
              id="collectionMethod"
              name="collectionMethod"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Customer generic 1</label>
            <TextField
              id="customerGen1"
              name="customerGen1"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>Last store CD</label>
            <TextField
              id="lastStoreCD"
              name="lastStoreCD"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Customer generic 2</label>
            <TextField
              id="customerGen2"
              name="customerGen2"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
        <div className={classes.formGroupAdd}>
          <>
            <label>customer rank</label>
            <TextField
              id="customerRank"
              name="customerRank"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
          <>
            <label>Customer generic 3</label>
            <TextField
              id="customerGen3"
              name="customerGen3"
              className={classes.smallInputField}
              InputProps={{ disableUnderline: true }}
              onChange={handleChange}
            />
          </>
        </div>
      </form>
    </React.Fragment>
  );
};

export default CustomerSIAdd;
